ture_zh:["\u4e00\u4e2a\u56db\u6838 Cortex A76 \u548c\u4e00\u4e2a\u56db\u6838 Cortex A55","\u795e\u7ecf\u7f51\u7edc\u5904\u7406\u5668\u7b97\u529b\u8fbe\u5230 6TOPs","4GB/8GB/16GB \u7684LPDDR4x\u5185\u5b58\u9009\u62e9","\u652f\u6301 H.264/H.265 \u7b49\u89c6\u9891\u89e3\u7801\u5668\u548c\u7f16\u7801\u5668"],sub_feature_en:["A Quad Cortex A76 and a Quad Cortex A55","NPU computing power up to 6TOP","4GB/8GB/16GB of LPDDR4x memory options","Support H.264/H.265 video decoder and encoder"],product_introduction_zh:"\u4f53\u9a8c Radxa ROCK 5A \u7684\u9ad8\u6269\u5c55\u6027\u548c\u591a\u529f\u80fd\u6027\uff0c\u6ee1\u8db3\u60a8\u6240\u6709\u8ba1\u7b97\u9700\u6c42\u7684\u4f18\u79c0\u4fe1\u7528\u5361\u5927\u5c0f SBC\u3002\u51ed\u501f\u5176\u9ad8\u6027\u80fd\u7684 Rockchip RK3588S \u5904\u7406\u5668\uff0c4/8/16GB\u53ef\u9009\u5185\u5b58\u548c\u5927\u91cf\u7684\u63a5\u53e3\u8fde\u63a5\u9009\u9879\uff0cROCK 5A\u662fDIY\u9879\u76ee\u3001\u673a\u5668\u4eba\u6280\u672f\u3001\u4eba\u5de5\u667a\u80fd\u7b49\u7684\u5b8c\u7f8e\u9009\u62e9\u3002\u7528 Radxa ROCK 5A \u5c06\u4f60\u7684\u521b\u9020\u529b\u63d0\u9ad8\u5230\u4e00\u4e2a\u65b0\u7684\u6c34\u5e73\uff0c\u4f60\u7684\u521b\u65b0\u7684\u4e00\u4f53\u5316\u89e3\u51b3\u65b9\u6848\u3002",product_introduction_en:"Experience the high scalability and versatility of the Radxa ROCK 5A, an excellent credit card-sized SBC for all your computing needs. with its high-performance Rockchip RK3588s processor, 4/8/16GB of selectable memory and plenty of interface connectivity options, the ROCK 5A is perfect for DIY projects, robotics, artificial intelligence and more. Take your creativity to the next level with the Radxa ROCK 5A, your all-in-one solution for innovation.",thumbnail_picture:"/rock5/rock_5a/thumb_rock5a.webp",banner_picture:"/rock5/rock_5a/banner_rock5a.webp",spec_pictures:["/rock5/rock_5a/spec_rock5a_01.webp","/rock5/rock_5a/spec_rock5a_02.webp","/rock5/rock_5a/spec_rock5a_03.webp"],marked_picture:["/rock5/rock_5a/marked_rock5a.webp"],para